--集客ddl
drop table if exists JK_CIRCUIT;
drop table if exists JK_EQUIPMENT;
drop table if exists JK_PORT;
drop table if exists JK_ROUTE;
CREATE TABLE JK_CIRCUIT (
	province_id VARCHAR ( 500 ),
	sdn VARCHAR ( 500 ),
	zh_label VARCHAR ( 500 ),
	circuit_no_province VARCHAR ( 500 ),
	rate VARCHAR ( 500 ),
	a_equip_sdn VARCHAR ( 500 ),
	a_port_sdn VARCHAR ( 500 ),
	z_equip_sdn VARCHAR ( 500 ),
	z_port_sdn VARCHAR ( 500 ),
	dims_col_result TEXT,
    dims_col_rtName TEXT 
);
CREATE TABLE JK_EQUIPMENT (
	province_id VARCHAR ( 500 ),
	sdn VARCHAR ( 500 ),
	ne_type VARCHAR ( 500 ),
	ne_name VARCHAR ( 500 ),
	vendor VARCHAR ( 500 ),
	status VARCHAR ( 500 ),
	building_name VARCHAR ( 500 ),
	dims_col_result TEXT,
    dims_col_rtName TEXT 
);
CREATE TABLE JK_PORT (
	province_id VARCHAR ( 500 ),
	sdn VARCHAR ( 500 ),
	port_name VARCHAR ( 500 ),
	equip_sdn VARCHAR ( 500 ),
	dims_col_result TEXT,
    dims_col_rtName TEXT 
);
CREATE TABLE JK_ROUTE (
	sdn VARCHAR ( 500 ),
	circuit_sdn VARCHAR ( 500 ),
	sequence_no VARCHAR ( 500 ),
	orig_point_sdn VARCHAR ( 500 ),
	orig_port_sdn VARCHAR ( 500 ),
	dest_point_sdn VARCHAR ( 500 ),
	dest_port_sdn VARCHAR ( 500 ),
	dims_col_result TEXT,
    dims_col_rtName TEXT 
);
create index if not exists idx_JK_CIRCUIT2intId on JK_CIRCUIT(sdn);
create index if not exists idx_JK_EQUIPMENT2intId on JK_EQUIPMENT(sdn);
create index if not exists idx_JK_PORT2intId on JK_PORT(sdn);
create index if not exists idx_JK_ROUTE2intId on JK_ROUTE(sdn);

